import React, { useEffect, useState } from 'react';

const TableData = () => {
    const [show, setShow] = useState(true);
    const [users, setUser] = useState({
        'User Name': 'string',
        'First Name': 'string',
        'Last Name': 'string',
        'Display Name': 'string',
        'Job Title': 'string',
        Department: 'string',
        'Office Number': 'string',
        'Office Phone': 'string',
        'Mobile Phone': 'string',
        Fax: 'string',
        Address: 'string',
        City: 'string',
        'State or Province': 'string',
        'ZIP or Postal Code': 'string',
        'Country or Region': 'string'
      });
    useEffect(() => {
        fetch('/about')
            .then(res => res.json())
            .then(async (data) => {
                // await console.log(users)
                // await console.log(data)
                // await setUser(data);
                await console.log((data))
                console.log("done")
                setShow(true)


            })
    }, []);

    return (

        <>


            <div>
                {show &&
                    Object.keys(users).map((key, i) => (
                        <p key={i}>
                            <span>  {key}</span>
                            <span>   {users[key]}</span>
                        </p>
                    ))
                }
            </div>



            <div>
                <h1 className="text-4xl text-center my-10">
                    Dynamic Data in Table
                </h1>
            </div>

        </>
    );
};

export default TableData;
